import React from 'react';

import ProductCard from './ProductCard';
import { girlsuniformData } from '../../../Data/Girls/Girlsuniform';
import { boysuniformsData } from '../../../Data/Boys/Boysuniform';

const ProductPage = () => {
  return (
    <div className="product-page">
      <h1>Girls Uniform Collection</h1>
      <div className="product-list">
        {girlsuniformData.map((institution) => (
          institution.uniforms.map((uniform) => (
            <ProductCard key={uniform.id} uniformData={uniform} />
          ))
        ))}
      </div>

      <h1>Boys Uniform Collection</h1>
      <div className="product-list">
        {boysuniformsData.map((institution) => (
          institution.institutions.map((institutionData) => (
            institutionData.uniforms.map((uniform) => (
              <ProductCard key={uniform.id} uniformData={uniform} />
            ))
          ))
        ))}
      </div>
    </div>
  );
};

export default ProductPage;
